/* Libraries */
import React, { Fragment } from "react";
import {
    Routes,
    Route,
  } from "react-router-dom";

/* Components */
import { Header } from './components/header'
import { Home } from "./components/home/home";

export function App() {
  return (
    <Fragment>
        <Routes>
            <Route path="/" element={<Home />} />
        </Routes>
        <Header />
    </Fragment>
  );
}
